con:response.con:script:
// Inbound
def queryString = mockRequest.getQueryString().split("&")
def incomingValOne = queryString[0].split("=")[1]
def incomingValTwo = queryString[1].split("=")[1]
def incomingUUID = queryString[2].split("=")[1]

// Outbound
def result = incomingValOne.toInteger() + incomingValTwo.toInteger()
mockResponse.setPropertyValue("Request", result.toString())

def propObjString = "{UUID:" + incomingUUID + ", lastResult:" + result + "}"
context.setProperty(incomingUUID, propObjString)

def incomingUUID = mockRequest.getQueryString().split("=")[1].toString()
def storedData = context.getProperty(incomingUUID)

mockResponse.setPropertyValue("Request", storedData.toString())

log.info(context.getPropertyNames().toString())
